export const themeColors = {
  darkBlue: "#193441",
  deepBlue: "#3E606F",
  midGreen: "#91AA9D",
  beige: "#D1DBBD",
  lightCream: "#FCFFF5",
};

export const transition = {
  easeInOut: "cubic-bezier(0.4, 0, 0.2, 1)",
};
